    .header-container {
      flex-direction: row;
      justify-content: flex-start;
      align-items: flex-start;
    }
  
    nav ul, .banner-big, .carousel-container {
      width: auto;
    }
  
    .slide-content .news-image {
      width: 100%;
      overflow: hidden;
    }
  
    .arrow-right {
      left: 92%;
    }
  
    main {
      width: 625px;
      flex-direction: column;
    }
  
    aside {
      margin: 10px auto;
    }
  
    .carousel2 .carousel-container {
      width: auto;
      margin: 18px 0 19px 0;
  
      .carousel-2-slide {
        width: 100%;
      }
    }
  
    .carousel-arrows {
      position: relative;
      top: 100px;
    }
  
    .images-row-img {
      width: 70px;
      height: 70px;
      margin-top: 10px;
    }
  
    footer {
      height: auto;
    }
  
    .footer-wrapper {
      width: auto;
      height: auto;
    }
  
    .footer-container, .footer-container-2 {
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
  
    .footer-bottom-container {
      width: auto;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
  }
  
  @media (max-width: 640px) {
    header {
      height: auto;
    }
  
    .header-container {
      flex-direction: column;
    }
  
    nav {
      height: auto;
    }
  
    #menu-icon {
      display: block;
      padding: 10px;
    }
  
    #ul-menu {
      display: none;
    }
  
    main {
      width: auto;
    }

    .slide-content .news-image {
      width: 100%;
      object-fit: cover;
    }
  
    .slide-info {
      bottom: 0;
  
      h1 {
        font-size: 20px;
        width: 400px;
      }
    }
  
    .arrow-right {
      left: 87%;
    }
  
    .news-container {
      width: auto;
      margin: 0 auto 18px auto;
      height: auto;
      flex-direction: column;
    }
  
    .news-box {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
  
    .news-container .news-box-container {
      .news-box {
        .news-image, .sport-image {
          width: 100%;
          height: 100%;
        }
      }
  
      flex-direction: column;
    }
  
    .business {
      .news-box-container {
        display: flex;
        flex-direction: column;
      }
  
      .business-box {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
  
        .business-image {
          width: 100%;
          height: 100%;
        }
  
        .business-heading {
          width: auto;
        }
  
        .business-date {
          width: auto;
          padding-left: 0;
        }
      }
    }
  
    .banner-small {
      width: 100%;
    }
  
    .news-carousel-container {
      width: auto;
      height: auto;
      margin-right: 0;
    }
  
    .news-carousel-container-box {
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
  
    .news-carousel-box {
      width: auto;
      height: auto;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
  
      .news-image {
        width: 100%;
        height: 100%;
      }
    }
  
    .editorials-local-news-container {
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
  
    .editorials-container {
      width: auto;
      margin-bottom: 18px;
    }
  
    .local-container {
      width: auto;
      margin-bottom: 18px;
      margin-left: 0;
    }
  
    .editorial-box, .local-box {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
  
    .editorial-box .editorial-image, .local-box .local-image {
